package com.java;

public class ListOfOddno {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int number = 100;
		System.out.println("List of odd no :" + number);
		for(int i=1;i<=number;i++) {
			
			if(i%2!=0) {
				
				System.out.println(i+ "");
			}
		}

	}

}
